import "./menu-item.component.scss";

export const MenuItem = ({ head, sub }) => {
  return (
    <div className="menu-item">
      <div className="content">
        <h1 className="heading">{head}</h1>
        <span className="subtitle">Shop Now</span>
      </div>
    </div>
  );
};
